import{_ as e,a as s}from"./chunks/7.BLDa2qA8.js";import{_ as i,c as t,ab as o,o as r}from"./chunks/framework.DnBlaP3q.js";const l="/blog-site/assets/1.DZJUf2No.png",p="/blog-site/assets/2.CRwRfWaW.png",n="/blog-site/assets/3.D2hZ_nxq.png",A="/blog-site/assets/4.DD-vKa14.png",c="/blog-site/assets/5.CSh1_1VE.png",h="/blog-site/assets/6.YSJ_WIql.png",m="data:image/png;base64,",d="/blog-site/assets/23.D5Wp6R6q.png",g="data:image/png;base64,",b="/blog-site/assets/25.lVFm4doX.png",u="/blog-site/assets/26.B4RS7tB0.png",B="/blog-site/assets/27.Dibk6MFA.png",S="/blog-site/assets/8.CikGejDo.png",C="/blog-site/assets/9.BxU3bY7v.png",w=JSON.parse('{"title":"什么是 SVN","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"version-manage/2svn/1svn安装及配置.md","filePath":"version-manage/2svn/1svn安装及配置.md"}'),V={name:"version-manage/2svn/1svn安装及配置.md"};function f(E,a,v,k,N,I){return r(),t("div",null,a[0]||(a[0]=[o('<h1 id="什么是-svn" tabindex="-1">什么是 SVN <a class="header-anchor" href="#什么是-svn" aria-label="Permalink to &quot;什么是 SVN&quot;">​</a></h1><ul><li>SVN 全称 SubVersion</li><li>SVN 是近年来崛起的版本管理工具，是 CVS 的接班人。目前，绝大多数软件公司都使用 SVN 作为代码版本管理软件。</li></ul><h2 id="特点" tabindex="-1">特点 <a class="header-anchor" href="#特点" aria-label="Permalink to &quot;特点&quot;">​</a></h2><ul><li>操作简单，入门容易</li><li>支持跨平台（Window/Linux/MacOS)</li><li>支持版本回退功能（时间机器）</li></ul><h2 id="获取-svn-软件" tabindex="-1">获取 SVN 软件 <a class="header-anchor" href="#获取-svn-软件" aria-label="Permalink to &quot;获取 SVN 软件&quot;">​</a></h2><p>属于 C/S 结构软件（客户端与服务器端）</p><p>服务端软件：<a href="https://gitee.com/mao-118/utools-filebed/raw/master/svn/VisualSVN-Server-2.7.7.msi" target="_blank" rel="noreferrer">VisualSVN</a></p><p>客户端软件：TortoiseSVN</p><p><a href="https://gitee.com/mao-118/utools-filebed/raw/master/svn/TortoiseSVN-1.8.10.26129-x64-svn-1.8.11.msi" target="_blank" rel="noreferrer">win64</a></p><p><a href="https://gitee.com/mao-118/utools-filebed/raw/master/svn/LanguagePack_1.8.10.26129-x64-zh_CN.msi" target="_blank" rel="noreferrer">win64 中文包</a></p><p><a href="https://gitee.com/mao-118/utools-filebed/raw/master/svn/TortoiseSVN-1.8.10.26129-win32-svn-1.8.11.msi" target="_blank" rel="noreferrer">win32</a></p><p><a href="https://gitee.com/mao-118/utools-filebed/raw/master/svn/LanguagePack_1.8.10.26129-win32-zh_CN.msi" target="_blank" rel="noreferrer">win32 中文包</a></p><p>点击下一步直至安装结束即可。</p><h2 id="服务端配置" tabindex="-1">服务端配置 <a class="header-anchor" href="#服务端配置" aria-label="Permalink to &quot;服务端配置&quot;">​</a></h2><h3 id="一、创建版本仓库" tabindex="-1">一、创建版本仓库 <a class="header-anchor" href="#一、创建版本仓库" aria-label="Permalink to &quot;一、创建版本仓库&quot;">​</a></h3><ol><li><p>首先在 SVN 服务器端创建一个公有目录 WebApp 做为项目目录</p></li><li><p>在 WebApp 目录下创建 Shop 文件夹，做为 Shop（版本仓库） <img src="'+l+'" alt=""></p></li><li><p>创建版本仓库，基本语法：</p></li></ol><p>svnadmin create Shop 文件夹路径（Shop 仓库） <img src="'+p+'" alt=""></p><p>如果 Shop 仓库配置成功，那么 Shop 文件夹会显示以下目录结构 <img src="'+n+'" alt=""></p><h3 id="二、启动服务端" tabindex="-1">二、启动服务端 <a class="header-anchor" href="#二、启动服务端" aria-label="Permalink to &quot;二、启动服务端&quot;">​</a></h3><p>基本语法： svnserve -d（后台运行） -r（监管目录） 版本仓库目录 <img src="'+A+'" alt=""> 通过以上指令，我们的 <code>svn://localhost</code> 或 ip 地址就可以直接指向 Shop 版本仓库</p><h3 id="三、客户端连接" tabindex="-1">三、客户端连接 <a class="header-anchor" href="#三、客户端连接" aria-label="Permalink to &quot;三、客户端连接&quot;">​</a></h3><p>Apache <code>http://localhost</code> 或(ip 地址)访问到 htdocs 目录下的相关文件（监管）</p><p>SVN <code>svn://localhost</code> 或(ip 地址)访问到相关数据仓库（如 Shop 仓库）</p><ul><li>如果有多个项目的话，<code>svnserve</code>可以启动项目的父目录，客户端连接的时候只需要带上项目的文件路径即可</li><li>如<code>http://localhost/Shop</code></li></ul><h3 id="四、权限控制" tabindex="-1">四、权限控制 <a class="header-anchor" href="#四、权限控制" aria-label="Permalink to &quot;四、权限控制&quot;">​</a></h3><h4 id="匿名用户权限控制" tabindex="-1">匿名用户权限控制 <a class="header-anchor" href="#匿名用户权限控制" aria-label="Permalink to &quot;匿名用户权限控制&quot;">​</a></h4><p>默认情况下，SVN 服务器是不允许匿名用户上传文件到服务器端的，所以必须更改系统相关配置文件。 <img src="'+c+'" alt=""> 更改第 19 行代码，去除前面的空格以及#号，更改其值为 write（可读写） <img src="'+h+'" alt=""></p><h4 id="账号权限控制" tabindex="-1">账号权限控制 <a class="header-anchor" href="#账号权限控制" aria-label="Permalink to &quot;账号权限控制&quot;">​</a></h4><ol><li><p>关闭匿名用户权限控制 <code>svnserve.conf</code>文件 <img src="'+m+'" alt=""></p></li><li><p>开启 <code>authz</code>文件和<code>passwd</code>文件 <img src="'+d+'" alt=""></p></li><li><p>编写<code>passwd</code>文件相关用户名与密码 <img src="'+g+'" alt=""></p></li><li><p>编写<code>authz</code>授权文件</p><ul><li>设置 groups 组 <img src="'+b+'" alt=""></li><li>给 groups 设置权限 <img src="'+u+'" alt=""><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>组中如有多个用户用逗号分开，如：admin = admin,root</p><p>r：可读</p><p>w：可写</p><p>*：其他所有用户</p></div></li></ul></li><li><p>配置成功后重新拉取或提交文件需要用户登录 <img src="'+B+'" alt=""></p></li></ol><h2 id="svn-客户端软件连接-svn-服务器" tabindex="-1">svn 客户端软件连接 SVN 服务器 <a class="header-anchor" href="#svn-客户端软件连接-svn-服务器" aria-label="Permalink to &quot;svn 客户端软件连接 SVN 服务器&quot;">​</a></h2><h3 id="_1-checkout-检出" tabindex="-1">1. Checkout 检出 <a class="header-anchor" href="#_1-checkout-检出" aria-label="Permalink to &quot;1. Checkout 检出&quot;">​</a></h3><p>首先在你的项目目录鼠标右键 TortoiseSVN 版本库浏览器输出 SVN 服务器地址： <img src="'+e+'" alt=""><img src="'+s+'" alt=""> svn://SVN 服务器地址  Shop 项目（仓库） <img src="'+S+'" alt=""> 检出成功之后该目录下会多出一个.svn 隐藏文件，代表检出成功 <img src="'+C+'" alt=""></p>',32)]))}const q=i(V,[["render",f]]);export{w as __pageData,q as default};
